void GCHQEditor::paint (Graphics& g)
{
    //[UserPrePaint] Add your own custom painting code here..
    g.fillAll (Colours::black);

    g.setColour (Colours::lime);
    g.setFont (Font (Font::getDefaultMonospacedFontName(), 20.00f, Font::bold));
    g.drawText (TRANS(currentProgramNameString),
                115, 59, 216, 37,
                Justification::centredLeft, true);

    g.setColour (Colours::lime);
    g.setFont (Font (Font::getDefaultMonospacedFontName(), 40.00f, Font::bold));
    g.drawText (TRANS(currentProgramNumberString),
                115, 19, 216, 37,
                Justification::centredLeft, true);

    //[/UserPrePaint]

    g.setColour (Colours::black);
    g.drawImage (cachedImage_background_png,
                 0, 0, 464, 120,
                 0, 0, cachedImage_background_png.getWidth(), cachedImage_background_png.getHeight());

    //[UserPaint] Add your own custom painting code here..
    if ( indicatorOn == true ) {
      g.drawImage (cachedImage_indicatorOn_png,
		   431, 3, 25, 28,
		   0, 0, cachedImage_indicatorOn_png.getWidth(), cachedImage_indicatorOn_png.getHeight());
    } else {
      g.drawImage (cachedImage_indicatorOff_png,
		   431, 3, 25, 28,
		   0, 0, cachedImage_indicatorOff_png.getWidth(), cachedImage_indicatorOff_png.getHeight());
    }
    //[/UserPaint]
}

