void GCHQEditor::sliderValueChanged (Slider* sliderThatWasMoved)
{
    //[UsersliderValueChanged_Pre]
    //[/UsersliderValueChanged_Pre]

    if (sliderThatWasMoved == gainInKnob)
    {
        //[UserSliderCode_gainInKnob] -- add your slider handling code here..
      processor.setParameterNotifyingHost( kGainInParameter,
					   static_cast<float>(gainInKnob->getValue())/(2.*kMaxGain)+0.5f );
        //[/UserSliderCode_gainInKnob]
    }
    else if (sliderThatWasMoved == gainOutKnob)
    {
        //[UserSliderCode_gainOutKnob] -- add your slider handling code here..
      processor.setParameterNotifyingHost( kGainOutParameter,
					   static_cast<float>(gainOutKnob->getValue())/(2.*kMaxGain)+0.5f );
        //[/UserSliderCode_gainOutKnob]
    }

    //[UsersliderValueChanged_Post]
    //[/UsersliderValueChanged_Post]
}

void GCHQEditor::buttonClicked (Button* buttonThatWasClicked)
{
    //[UserbuttonClicked_Pre]
    //[/UserbuttonClicked_Pre]

    if (buttonThatWasClicked == upButton)
    {
        //[UserButtonCode_upButton] -- add your button handler code here..
      processor.setParameterNotifyingHost( kProgramParameter,
					   processor.programToParameter(processor.currentProgram+1) );
      updateControls();
        //[/UserButtonCode_upButton]
    }
    else if (buttonThatWasClicked == downButton)
    {
        //[UserButtonCode_downButton] -- add your button handler code here..
      processor.setParameterNotifyingHost( kProgramParameter,
					   processor.programToParameter(processor.currentProgram-1) );
      updateControls();
        //[/UserButtonCode_downButton]
    }

    //[UserbuttonClicked_Post]
    //[/UserbuttonClicked_Post]
}



//[MiscUserCode] You can add your own definitions of your custom methods or any other code here...
void GCHQEditor::updateControls()  {
  gainInKnob->setValue( Decibels::gainToDecibels(processor.gainIn) );
  gainOutKnob->setValue( Decibels::gainToDecibels(processor.gainOut) );

  currentProgramNameString =
    kFIRPrograms.programs[processor.currentProgram].programName;
  currentProgramNumberString = "PR 0";
  currentProgramNumberString += String(processor.currentProgram+1);
  currentProgramNumberString += "/0";
  currentProgramNumberString += String(kFIRPrograms.numPrograms);
  repaint();
}

void GCHQEditor::setIndicator( bool indicator ) {
  if ( indicator != indicatorOn ) {
    indicatorOn = indicator;
    repaint();
  }
}
//[/MiscUserCode]


